import React from "react";
import "./hotel.css";
import types from "../../data/type.json";

const Hotel = () => {
  return (
    <div className="container">
      <div className="d-flex">
        {types.map((types) => (
          <div className="types-title">
            <img src={types.image} alt=""></img>
            <p>{types.name}</p>
            <p>{types.count}</p>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Hotel;
